import React from 'react';
import {Typography, Box} from '@mui/material/';

const Home = () => {
  return (
    <div>
      <Box
        sx={{
          marginLeft: 1,
        }}
      >
        <Typography variant="h1">React Portfolio</Typography>

      </Box>

      <Box
        sx={{
          marginLeft: 2,
        }}
      >
        <Typography variant="body1">Welcome to my React Portfolio! Click the book icon on the bottom right to select a page.</Typography>

      </Box>

    </div>

  );

};

export default Home;
